Hay mucho de lo que hablar en el nuevo juego de Naughty Dog, y por eso muchos críticos optamos por dar unas pocas pinceladas sobre la historia y centrarnos en la apabullante parte tecnológica. Sus virtudes son indiscutibles y permiten dejar a un lado en algo que, primero por obligación y luego por respeto a los jugadores, no podíamos desvelar. Pasados unos días, y siendo ya más o menos de dominio público las peculiaridades del juego pasado su ecuador, vamos a adentrarnos en lo que hace bien y lo que hace mal. Sobra decir que a partir de aquí abundan spoilers de todo tipo.<p></div></div><div></section></body><br><br><?php include("../Comentarios/index.php");?><br><div name = "footer" id = "footer"><?php include("../../../d/Parte/footer.html"); ?></div></html>